import React from "react";

const ShowCourses = () => {
  return (
    <div style={{ backgroundColor: "white", color: "black" }}>
      <h2>Want to learn something new ?</h2>
      <h2>Enroll Now</h2>
    </div>
  );
};

export default ShowCourses;
